INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-04-26 21:10:21.447', 'John needs gluten free, allergy friendly dough for pizza / crackers. We bake the pizza half with sauce and toppings and half plain - the plain side turns into crackers.', 'ck9hjr0ug00023f7z7kq1r5g1', NULL, NULL, 'John''s Pizza/Cracker Dough', '2020-04-26 21:11:33.512');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-12-30 01:28:46.115', 'A great tasting alternative to making stew with stew beef - serve with rice.', 'ckjaqqqzn01922t41ye9x8a34', 'This version subs out some ingredients from the original - reference the source link if you have less restrictions', 'https://www.allrecipes.com/recipe/201085/molasses-beef-curry/', 'Japanese-style beef curry', '2021-04-26 17:59:15.645');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2021-03-21 16:37:00.89', 'This is a great mug cake recipe that rises well and tastes good. Feel free to adjust sugar as needed.', 'ckmjdurfe0829573s49k8g5ty', 'Use a large mug - a regular sized coffee mug is too small. Alternatively, a bowl also works, but will not rise as high.', 'https://www.allrecipes.com/recipe/241038/microwave-chocolate-mug-cake/', 'Mug cake', '2021-03-25 01:03:18.905');
