INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-05-04 23:01:31.897', 'These are really great brownies that are not too overly sweet, and have nice soft texture. I like that it uses a reasonable amount of ingredients as well.', 'ck9t38t4p00003j5zc26b09wr', 'Be sure to read up on extra tips at the source website, specifically, use parchment to line the bottom of the pan for easier removal, and don''t skip the order and process for mixing the ingredients.', 'https://www.inspiredtaste.net/24412/cocoa-brownies-recipe/', 'Fudgy Dark Chocolate Brownies', '2021-05-02 21:50:29.34');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-02-21 08:00:00', '', 'ck5kdo5q100173y6lwwkvchkq', '', 'https://www.foodnetwork.com/recipes/robert-irvine/french-toast-recipe-1951408.amp', 'French Toast', '2021-04-03 13:41:10.19');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-02-21 08:00:00', 'This is my go-to blueberry muffin recipe when I feel like them in the morning. The original recipe came from Urban Girl Bakes (blog no longer exists), and I’ve adapted it so that it fills the whole muffin tin, as the original recipe only made 8 for some reason. I usually use frozen blueberries, but you really need to try to get rid of as much moisture from them as possible to prevent sinking to the bottom. Fresh blueberries if possible make the recipe a lot better.', 'ck61fps490073285hqv9gfeob', NULL, 'UrbanGirlBakes', 'Blueberry Muffins', '2021-07-03 12:45:20.199');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-02-21 08:00:00', 'I’ve tried a lot of pancake recipes (including many frou-frou ones). But I always come back to the Better Homes and Gardens recipe which is just a solid American pancake recipe. However, their recipe is just too small of a yield, so my version is doubled and results in enough leftovers for another day or two after. If I have guests, I’ll typically make 50% more batter.', 'ck5vm8wx30037285htgcq6vqa', NULL, 'http://www.bakespace.com/recipes/detail/Better-Homes-And-Gardens%27-Buttermilk-Pancakes/32204/', 'Pancakes', '2021-10-28 12:05:31.513');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-02-21 08:00:00', 'This makes a very nice, “fluffier than usual” gingerbread cookie.', 'ck6qzqvlr0144285hw808bcnq', '', 'https://cooking.nytimes.com/recipes/1015813-gingerbread-cookies', 'Gingerbread Cookies', '2021-05-02 21:51:12.492');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2021-04-17 17:29:27.336', 'This is a warm and hearty black bean soup that is nice for cooler days.', 'cknm0m78o2540486201q1drbi', 'Please don''t skip the jalapeno, the spiciness cooks out.', 'https://janetishungry.blogspot.com/2009/05/black-bean-soup.html', 'Black Bean Soup', '2021-04-17 17:57:52.337');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-02-21 08:00:00', 'This is our go-to hot chocolate recipe with a little kick', 'ck6vgvfhf0166285hxguczij1', '', 'FitPregnancy.com', 'Hot Chocolate', '2021-05-02 21:50:48.592');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-03-22 19:25:41.09', 'This is very similar to our regular waffle recipe except it''s a little heartier and thicker with the molasses and ginger.', 'ck83fllk200003z2l3036fvts', 'Makes 6 in a waffle iron', 'Borrowed from the Jubilee cookbook', 'Gingerbread Waffles', '2022-05-02 19:01:35.164');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-02-21 08:00:00', 'Makes for an excellent home made chai tea.', 'ck61fyywo0096285hd7q82vwj', 'I make this in a smaller quantity than the linked recipe, but the proportions are the same.', 'https://keeperofthehome.org/how-to-make-real-indian-masala-chai-tea-in-5-minutes-2/', 'Chai Tea Mix', '2021-07-02 12:32:10.943');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-02-21 08:00:00', 'This is an “improved” version of the recipe from The Kitchn. I essentially make 50% more of the recipe which results in a more substantial product. I cook mine in a 10′′ cast iron skillet.', 'ck5wj9tp80056285hj3v1n8kt', NULL, 'https://www.thekitchn.com/how-to-make- a-dutch-baby-pancake-227629', 'Dutch Baby', '2021-07-27 02:26:36.983');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2020-02-21 08:00:00', 'My waffle maker is a lower-cost one, and doesn’t have a lot of clearance between the quarters – meaning if the mixture is too thin or crispy, it will fall apart when trying to take it out of the iron. This recipe ticks the boxes for my equipment and always results in great, light waffles that hold together well. Mix in blueberries or chocolate chips if you desire, but I’ve started to just make them plain and add these on the side for toppings instead.', 'ck5v2n8cl0000285hrfguk0vb', '', 'https://www.food.com/recipe/the-best-belgian-waffles-63071', 'Waffles', '2021-05-02 21:49:47.64');
INSERT INTO public."Recipe" ("authorId", "createdAt", description, id, notes, source, title, "updatedAt") VALUES ('ck5kdl1g600002b6lux9j07fn', '2021-06-21 00:02:18.693', 'Sometimes it''s nice to jazz up your pasta. I made this recently and added chopped mushroom and sausage along with farfalle pasta, and it was great.', 'ckq5utxon123375020c5ezycxp', '', 'https://lilluna.com/creamy-garlic-penne-pasta/', 'Garlic Alfredo Sauce', '2021-06-21 00:08:49.729');
