INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Melt butter in a medium sauce pan, add garlic.', 'ckq5v1ea0134755020kex0ydyx', 'ckq5uvnfm124595020pnlxg88s', 0, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Cook for 1 minute over medium heat.', 'ckq5v1k31134915020luae4u1u', 'ckq5uvnfm124595020pnlxg88s', 1, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Remove the bowl from heat and set aside for a few minutes until it is only warm, not hot. Stir in the vanilla with a spoon, then add the eggs, one at a time, stirring vigorously after each one.', 'ck9t8apuq00133j5z8033r19n', 'ck9t3bliw00013j5z0ahjn7ih', 3, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('When the batter looks thick, shiny and well blended (may still be a little gritty), add the flour and stir until fully incorporated, then beat with the wooden spoon or spatula for 40 to 50 strokes. (The batter will be thick). Beat vigorously until the batter is thickened and cohesive. Spread evenly in lined pan, top with some chocolate chips, if desired.', 'ck9t8c0n300143j5z9p543x16', 'ck9t3bliw00013j5z0ahjn7ih', 4, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Bake the brownies for 35 minutes or until a toothpick can be inserted into the center and come out almost clean (you may need another 5 minutes). As a visual test, brownies are done when the edges will look dry and the middle still looks slightly underbaked.', 'ck9t8dr8n00153j5zefyyqj5a', 'ck9t3bliw00013j5z0ahjn7ih', 5, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Cool completely then remove from pan. For the cleanest lines when cutting, place into the freezer for 20 to 30 minutes to firm up. Cut into 16 squares.', 'ck9t8fkgm00163j5z755p1nu3', 'ck9t3bliw00013j5z0ahjn7ih', 6, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Add flour and cook for an additional minute, stirring constantly.', 'ckq5v1ryz135085020t6rpe41a', 'ckq5uvnfm124595020pnlxg88s', 2, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Add milk and broth, stirring constantly. Cook until sauce boils and thickens.', 'ckq5v20ss135245020u8hsfogx', 'ckq5uvnfm124595020pnlxg88s', 3, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Add parsley and parmesan cheese. Add desired salt and pepper. Continue stirring until cheese has melted. Serve immediately.', 'ckq5v236u135405020dfwrggfy', 'ckq5uvnfm124595020pnlxg88s', 4, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Add fresh ginger if possible, otherwise a dash of ground ginger will suffice.', 'ck61g623c0121285hso7juaxf', 'ck61g1wbz0107285h8c1lrdx6', 1, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Add sugar and milk, bring back to a boil.', 'ck61g6yzn0122285h0z3jvaiw', 'ck61g1wbz0107285h8c1lrdx6', 2, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Remove from heat, let sit 3-5 minutes.', 'ck61g79hm0123285hm4nzvtmd', 'ck61g1wbz0107285h8c1lrdx6', 3, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Strain through a sieve, and then serve.', 'ck61g7gd10124285hpo8p9xmf', 'ck61g1wbz0107285h8c1lrdx6', 4, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Lightly grind together spices in a mortar and pestle, you do not need to make it a powder, just enough to crush the cardamom pods and a few of the cloves/peppercorns.', 'ck61g52q30117285hdnivo8fi', 'ck61g0b040098285hh7ricbv8', 0, NULL);
INSERT INTO public."Step" (description, id, "recipeSectionId", "order", "fileId") VALUES ('Place spice mixture in a sealed container for future use.', 'ck61g5hb90119285hf34f9qi0', 'ck61g0b040098285hh7ricbv8', 1, NULL);
